@pranavsharma 
I'm seeing the following error when testing topk with int64 tensor:

onnxruntime.capi.onnxruntime_pybind11_state.RuntimeException: [ONNXRuntimeError] : 6 : RUNTIME_EXCEPTION : Non-zero status code returned while running TopK node. Name:'TopK_15' Status Message: /home/neraoof/onnxruntime/include/onnxruntime/core/framework/tensor.h:150 const T* onnxruntime::Tensor::Data() const [with T = float] utils::IsPrimitiveDataType<T>(dtype_) was false. Tensor type mismatch. T !=N11onnxruntime17PrimitiveDataTypeIlEE

This is the PyTorch model test:

    def test_topk_int(self):
        class MyModule(torch.nn.Module):
            def forward(self, x):
                return torch.topk(x, 3)

        x = torch.randint(0, 10, (1, 6), dtype=torch.int64)
        self.run_test(MyModule(), x)

